53.body:
Expressions are simple scripts to perform pixel-wise computations. One can refer to the raster inputs as A for the first raster, B for the second, and so on. Furthermore, expressions can check with A IS NODATA, B IS NODATA, etc. for NO DATA values. This is important if mapNoData is set to true. Otherwise, NO DATA values are mapped automatically to the output NO DATA value. Finally, the value NODATA can be used to output NO DATA. Users can think of this implicit function signature for, e.g., two inputs: fn (A: f64, B: f64) -> f64 As a start, expressions contain algebraic operations and mathematical functions. (A + B) / 2 In addition, branches can be used to check for conditions. if A IS NODATA { B
} else { A
} Function calls can be used to access utility functions. max(A, 0) Currently, the following functions are available: abs(a): absolute value min(a, b), min(a, b, c): minimum value max(a, b), max(a, b, c): maximum value sqrt(a): square root ln(a): natural logarithm log10(a): base 10 logarithm cos(a), sin(a), tan(a), acos(a), asin(a), atan(a): trigonometric functions pi(), e(): mathematical constants round(a), ceil(a), floor(a): rounding functions mod(a, b): division remainder to_degrees(a), to_radians(a): conversion to degrees or radians To generate more complex expressions, it is possible to have variable assignments. let mean = (A + B) / 2;
let coefficient = 0.357;
mean * coefficient Note, that all assignments are separated by semicolons. However, the last expression must be without a semicolon.

