There are several types of neighborhoods. They define a matrix of weights. The rows and columns of this matrix must be odd. WeightsMatrix The weights matrix is defined as an \( n \times m \) matrix of floating point values. It is applied to the pixel and its neighborhood to serve as the input for the aggregate function . For instance, a vertical derivative filter (a component of a Sobel filter) can be defined like this: { "type": "weightsMatrix", "weights": [ [1.0, 0.0, -1.0], [2.0, 0.0, -2.0], [1.0, 0.0, -1.0] ]
} The aggregate function should be sum in this case. Rectangle The rectangle neighborhood is defined by its shape \( n \times m \). The result is a weights matrix with all weights set to 1.0. { "type": "rectangle", "dimensions": [3, 3]
}
